import BoxRHS from "./Main/BoxRHS";

import "./Main.css";
import PatientReg from "./Main/Login_Reg/PatientReg";
import { Routes, Route } from "react-router-dom";
import DoctorLogin from "./Main/Login_Reg/DoctorLogin";
import PatientLogin from "./Main/Login_Reg/PatientLogin";
import DoctorReg from "./Main/Login_Reg/DoctorReg";

import IsLogin from "./Main/IsLogin";


const Main = () => {
  return (
    <div>      
      <Routes>
        <Route path="/" element={<BoxRHS/>} >
          <Route path="doctorlogin" element={<DoctorLogin Variable={IsLogin}/>} />
          <Route path="patientlogin" element={<PatientLogin Variable={IsLogin}/>} />
        </Route>      
        <Route path="patientRegistration" element={<PatientReg Variable={IsLogin}/>} />
        <Route path="doctorRegistration" element={<DoctorReg Variable={IsLogin}/>} />
      </Routes>
    </div>
  );
};

export default Main;
